const FormPage = () => {
  return (
    <MDBContainer>
      <MDBRow className="mt-5">
        <MDBCol md="6">
          <img
            className="img-fluid"
            src="https://image.freepik.com/vecteurs-libre/illustration-concept-coiffeur_114360-1565.jpg"
            alt=""
          />
        </MDBCol>
      </MDBRow>
    </MDBContainer>
  );
};

export default FormPage;
